import React from 'react'

function Watershed() {
  return (
    <div>
      <button>Bunner Watershed</button>
      <button>Kohistan Watershed</button>
      <button>Daur Watershed</button>
      <button>Kunhar Watershed</button>
      <button>Unhar Watershed</button>
    </div>
  )
}

export default Watershed;
